import React from "react";
import '../Assets/Styles/SkillPageStyles.css';
import TagSkillComponent from "../Components/TagSkillComponent";
import { useSpring, animated } from '@react-spring/web';
import { useInView } from 'react-intersection-observer';

function SkillPage(){
    const { ref, inView } = useInView({
        triggerOnce: true, 
        threshold: 0.1, 
      });
    const right = useSpring({
        opacity: inView ? 1 : 0,
        transform: inView ? 'translateX(0px)' : 'translateX(-20px)',
        config: { duration: 800 },
      });
      const top= useSpring({
        opacity: 1,
        transform: 'translateY(0px)',
        from: { opacity: 0, transform: 'translateY(20px)' },
        config: { duration: 800 }
      });
    const down= useSpring({
        opacity: 1,
        transform: 'translateY(0px)',
        from: { opacity: 0, transform: 'translateY(-20px)' },
        config: { duration: 800 }
      });

    return(
        <main className="main" id="skill">
            <section className="skill-container">
                <animated.h1 style={right} ref={ref}>My Skills as a Developer:</animated.h1>
                <div className="skills">
                    <TagSkillComponent skill="Java" style={down} ref={ref}></TagSkillComponent>
                    <TagSkillComponent skill="Python"></TagSkillComponent>
                    <TagSkillComponent skill="Mysql" style={down} ref={ref}></TagSkillComponent>
                    <TagSkillComponent skill="HTML5" style={down} ref={ref}></TagSkillComponent>
                    <TagSkillComponent skill="Css"></TagSkillComponent>
                    <TagSkillComponent skill="React" style={down} ref={ref}></TagSkillComponent>
                    <TagSkillComponent skill="Angular" style={down} ref={ref}></TagSkillComponent>
                    <TagSkillComponent skill="Spring"></TagSkillComponent>
                    <TagSkillComponent skill="Django" style={down} ref={ref}></TagSkillComponent>
                    <TagSkillComponent skill="Postman" style={down} ref={ref}></TagSkillComponent>
                    <TagSkillComponent skill="Figma"></TagSkillComponent>
                    <TagSkillComponent skill="Star UML" style={down} ref={ref}></TagSkillComponent>
                </div>
            </section>
        </main>
    );
}

export default SkillPage;
